import React, {Component} from 'react';


class HomePage extends Component{

  render(){
    return(
      <div>
          <h1> Thank you for visiting the dragon nest</h1>
          <br></br>
          <p>The dragon nest is where I get to show off who I am and what I have accomplished.
          My goal thus far in life is to work in a game company and make amazing games for the
          fans and people all over the world. </p>
          <p>I want to make games in almost every genre. </p>
      </div>
    );
  }
}
export default HomePage;
